import React, { useState } from 'react';
//import axios from 'axios';
import ProductCard from '../ProductCard/ProductCard';
import './ProductGateway.css';
import ProductView from '../ProductView/ProductView';
import ProductViewLoading from '../ProductViewLoading/ProductViewLoading';

function ProductGateway() {
  

  const products = [
    {
      id: 1,
      name: 'iPet',
      description: 'Sistema de gestão para petshop e/ou clínicas veterinárias',
      isComingSoon: false,
      categories: [
        {
          id: 1,
          name: 'Financeiro',
          image:
            {
              mime: 'image/png',
              data: ''
            }
        },
        {
          id: 2,
          name: 'Área de consultas'
        },
        {
          id: 3,
          name: 'Histórico'
        },
        {
          id: 4,
          name: 'Dashboard'
        },
      ]
    },
    {
      id: 2,
      name: 'Smart Circuits',
      description: 'Sistema de gestão para petshop e/ou clínicas veterinárias',
      isComingSoon: true,
      categories: [
        {
          id: 1,
          name: 'teste 2'
        },
        {
          id: 2,
          name: 'teste 2'
        },
        {
          id: 3,
          name: 'teste 2'
        },
      ]
    },
    {
      id: 3,
      name: 'Mais Ajuda',
      description: 'Sistema de gestão para petshop e/ou clínicas veterinárias',
      isComingSoon: true,
      categories: [
        {
          id: 1,
          name: 'teste 3'
        },
        {
          id: 2,
          name: 'teste 3'
        },
        {
          id: 3,
          name: 'teste 3'
        },
      ]
    }
  ];

    
  //console.log(axios.get('http://localhost:3001/products').then(resp => console.log(resp.data)));

  const productInitial = products.find(p => p.id === 1);

  const [selectedProduct, setSelectedProduct] = useState(productInitial);
  const [btnMoreInfo, setBtnMoreInfo] = useState(false);

  const handleProductSelected = (productId) => {
    const product = products.find(p => p.id === productId);

    setSelectedProduct(product);
    setBtnMoreInfo(false);
  };

  return ( 
    <div className="product-gateway" id="productGateway">
      <h2 className="h2">Otimize sua Operação e Potencialize a Produtividade com Nossos Softwares de Automação de Processos</h2>

      <div className="products-area container">
        {products.map(product => 
          <ProductCard 
            key={product.id} 
            {...product} 
            isSelected={selectedProduct && selectedProduct.id === product.id}
            onClick={() => handleProductSelected(product.id)}
            btnMoreInfo={btnMoreInfo}
            setBtnMoreInfo={setBtnMoreInfo}
          /> 
        )}
      </div>

      {
        !selectedProduct.isComingSoon ? (
          <ProductView product={selectedProduct}/>
        ) : (
          <ProductViewLoading />
        )
      }
      
    </div>
  );
}

export default ProductGateway;
